.login-wrap {
  box-sizing: border-box;
  width: 100%;
  height: 100%;
  padding-top: 5%;
  background-image: url(data:image/svg+xml;base64,);
  /* background-color: #112346; */
  background-repeat: no-repeat;
  background-position: center right;
  background-size: 100%;
}
.login-container {
  border-radius: 10px;
  margin: 0px auto;
  width: 880px;
  padding: 30px 20px 15px 20px;
  background: #fff;
  border: 1px solid #eaeaea;
  text-align: left;
  box-shadow: 0 0 20px 2px rgba(0, 0, 0, 0.1);
}
.login-left{
  width: 400px;
  display: inline-block;
}
.login-right{
  width: 390px;
  height: 350px;
  border-left: 1px solid #ccc;
  float: right;
  padding-left: 30px;
}
.login-right p{
  margin-bottom: 22px;
}
.title{
  text-align: center;
  margin-bottom: 20px;
}
.verifyCode{
  width: 69%;;
}
.verifyBtn{
  border: 0px solid #000;
}
.hint{
  color: #999;
  font-size:14px;
  font-weight: 700;
}
.hint:after{
  content: "";
  width: 81%;
  border-top: 1px #ccc solid;
  display: inline-block;
  vertical-align: middle;
}
.hint:after{
  margin-left: 10px;
}
.line /deep/ .el-form-item__content{
  margin-left: 15px !important;
  text-align: left;
}
.note{
  line-height: 25px;
}
.note .blue{
  color: #409EFF;
}
.goToLogin{
  color: #409EFF;
  border-color: #409EFF;
}
